Sub 'AnalizaModTrnAdelantado' // -- Verifica que el movimiento esta contabilizado y no anulado en la FSD015 &aProceso = 'N' &Itcont = 'S' &Itcorr = 99 For Each Order Pgcod, Itsuc, Itmod, Ittran, Itnrel //-- FSD015 Cabezal de Movimientos Where Pgcod = &pPgCod Where Itsuc = &Itsuc Where Itmod = &Itmod Where Ittran = &Ittran Where Itnrel = &Itnrel Where Itcont = &Itcont Where Itfcon = &FchHasta Where Itfvc = &FchHasta Where Itcorr <> &Itcorr Defined By Itcaja If Ithora <= &IthoraF ///-- Solo proceso lo del dia antes de las 17:00hs &aProceso = 'S' EndIf EndFor // FSD015
